  false,\n\t\"url\": null,\n\t\"notes\": \"Several sampling and documentation protocols
  were implemented to establish baseline vegetation data. These data will provide
  a comparison point for future resamplings at the site.  Detailed vegetational sampling
  was conducted in the dolomite glades, and general vegetation monitoring transects
  were installed across the entire hollow at both the north and south ends. A series
  of photomonitoring points were established and documented. To track tree demographics,
  four permanent 0.5 acre macroplots were established at selected woodland locations.\",\n\t\"owner_org\":
